import React, { Component } from 'react';
import '../App.css';
import books from '../books.json';
class App extends Component {
  render() {
    console.log(books)

    return (
      <div>
        {
        books.map(book, key => (
          <h1 key = {key}>{book.title}</h1>
        ))

        }
        </div>
    );
  }
}

export default App;
